import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  userName = 'Henrique Torres';
  userData = {
    email: 'henriquetlandin@gmail.com',
    role: 'Admin',
  }

  title = 'angular-basico';
}
